import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Use />}></Route>
          <Route path="/userProfile/:id" element={<UserProfile />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
